    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT + 46 BETWEEN + col1 * + 80 AND + col0 + + 84 + - col0 - + col0;
  - name: tab1

outputs:
  - name: q1085.out
    data: |
      51	14	96
      85	5	59
      91	47	68
